void UT_ExecuteVaHandler(UT_EntryKey_t FuncKey, const char *FunctionName, UT_VaHandlerFunc_t DefaultHandler,
                         va_list VaList)
{
    /* Logging probe: record entry and inputs */
    FILE *logf = fopen("/tmp/logs/448.txt", "a");
    if (logf != NULL)
    {
        fprintf(logf, "ENTER UT_ExecuteVaHandler\n");
        fprintf(logf, "  FunctionName: %s\n", FunctionName ? FunctionName : "(null)");
        fprintf(logf, "  DefaultHandler: %p\n", (void *)DefaultHandler);
        fflush(logf);
    }

    /* Preserve original logic but capture the result of UT_GetStubEntry so we can log the control path */
    void *stubEntry = UT_GetStubEntry(FuncKey, UT_ENTRYTYPE_FINAL_HANDLER);

    if (logf != NULL)
    {
        fprintf(logf, "  UT_GetStubEntry returned: %p\n", stubEntry);
        fflush(logf);
    }

    if (stubEntry == NULL && DefaultHandler != NULL)
    {
        if (logf != NULL)
        {
            fprintf(logf, "  Condition met: stubEntry==NULL && DefaultHandler!=NULL -> calling UT_SetVaHandlerFunction\n");
            fflush(logf);
        }
        UT_SetVaHandlerFunction(FuncKey, DefaultHandler, NULL);
    }
    else
    {
        if (logf != NULL)
        {
            fprintf(logf, "  Condition not met: not setting default handler (stubEntry=%p, DefaultHandler=%p)\n", stubEntry, (void *)DefaultHandler);
            fflush(logf);
        }
    }

    if (logf != NULL)
    {
        fprintf(logf, "  About to call UT_DefaultStubImplWithArgs\n");
        fflush(logf);
    }

    UT_DefaultStubImplWithArgs(FunctionName, FuncKey, 0, VaList);

    if (logf != NULL)
    {
        fprintf(logf, "EXIT UT_ExecuteVaHandler\n");
        fclose(logf);
    }
}
